import React from 'react';

const Contact = () => {
  return (
    <section className="contact">
      <h1>Contact Me</h1>
      <div className="contact-info">
        <p><strong>Email:</strong> mridul@example.com</p>
        <p><strong>Phone:</strong> +917000552842</p>
        <p><strong>LinkedIn:</strong> <a href="https://www.linkedin.com/in/mriduldas08/" target="_blank" rel="noopener noreferrer">linkedin.com/in/mridulhu</a></p>
        <p><strong>GitHub:</strong> <a href="https://github.com/MridulHu" target="_blank" rel="noopener noreferrer">github.com/MridulHu</a></p>
      </div>
    </section>
  );
};

export default Contact;
